import React from "react";
import { BrowserRouter as Router, Route, Redirect, Switch } from "react-router-dom";

import Users from './users/pages/Users';
import './App.css';
import Location from "./locations/pages/Location";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <Users />
        </Route>
        <Route path="/pages/new" exact>
          <Location />
        </Route>
        <Redirect to="/" />
      </Switch>
    </Router>
  );
}

export default App;
